import { createRouter, createWebHistory } from 'vue-router'

//引入布局组件
import Layout from '../views/Layout/index.vue'
const routes = [
  {
    path: '/',
    name: 'Login',
    hidden: true,
    meta: {
      name: '登录'
    },
    //按需加载
    component: () => import('../views/Login.vue')
  },
  {
    path: '/:catchAll(.*)',
    name: '404',
    hidden: true,
    meta: {
      name: '404页面'
    },
    //按需加载
    component: () => import('../views/404/404.vue')
  },

  {
    path: '/carousel',
    name: 'system',
    //重定向
    meta: {
      name: '公告管理',
      icon: 'Stopwatch'
    },
    //控制台
    component: Layout,
    children: [
      {
        path: '/notice',
        name: 'Notice',
        meta: {
          name: '医院公告',
        },
        component: () => import('../views/System/notice.vue')
      },
      {
        path: '/carousel',
        name: 'Carousel',
        meta: {
          name: '轮播图管理',
        },
        component: () => import('../views/System/carousel.vue')
      }
    ]
  },
  {
    path: '/carousel',
    name: 'doctor',
    //重定向
    meta: {
      name: '医院管理',
      icon: 'Stopwatch'
    },
    //控制台
    component: Layout,
    children: [
      {
        path: '/doctor',
        name: 'doctor',
        meta: {
          name: '医院管理',
        },
        component: () => import('../views/Doctor/doctor.vue')
      },
    ]
  },
  {
    path: '/carousel',
    name: 'department',
    //重定向
    meta: {
      name: '科室管理',
      icon: 'Stopwatch'
    },
    //控制台
    component: Layout,
    children: [
      {
        path: '/department',
        name: 'department',
        meta: {
          name: '医院公告',
        },
        component: () => import('../views/Department/index.vue')
      },
    ]
  },
  {
    path: '/carousel',
    name: 'user',
    //重定向
    meta: {
      name: '用户管理',
      icon: 'Stopwatch'
    },
    //控制台
    component: Layout,
    children: [
      {
        path: '/user',
        name: 'user',
        meta: {
          name: '用户信息',
        },
        component: () => import('../views/User/index.vue')
      },
    ]
  },
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})


export default router
